import Button from "@atlaskit/button";
import React from "react";
import styled from "styled-component";

const ButtonStyled = styled(Button)`
    margin-top: 5px;
    text-align: left; 
` 

export default function TodoList() {
    return (     
        <>
            <Button shouldFitContainer >Item 1</Button>
        </>
    );
}
